import React from 'react';
import TextFieldDemo from './pages';

export default App = () => {
  return (
    <div id="root">
      <TextFieldDemo name="disable" />
      <TextFieldDemo name="valid" />
      <TextFieldDemo name="error" />
    </div>
  );
}
